 */
function Home() {
  const [mailbox, setMailbox] = React.useState('');
  const [mailid, setMailid] =
    React.useState('be39a2f4-212b-4eb3-901c-21aef614c364');
  return (
    <SharedContext.Provider
      value={{mailbox, setMailbox, mailid, setMailid}}>
      {(mailbox!=='')&&<TopBar />}
      {(mailbox!=='')&&<MailList />}
      {(mailid!=='')&&<MailView />}
